import React, { useState } from 'react';
import { DndProvider } from 'react-dnd';
import { HTML5Backend } from 'react-dnd-html5-backend';

// Mock data for data sources
const DATA_SOURCES = [
  { name: 'Telegram', connected: false, icon: 'üì±' },
  { name: 'Smart Wallets', connected: false, icon: 'üíº' },
  { name: 'Token Market Data', connected: true, icon: 'üìä' }
];

// Available filters
const AVAILABLE_FILTERS = [
  { label: 'Token mentioned in Telegram', tooltip: 'Triggered when a token appears in your connected chats' },
  { label: 'Smart Wallet Buys', tooltip: 'Uses wallets you\'ve imported to detect buys' },
  { label: 'Price Retracement', tooltip: 'Triggers when a token drops from its ATH or a recent peak' },
  { label: 'Volume Spike', tooltip: 'Detects tokens with sudden volume increases' }
];

const EXAMPLE_PROMPTS = [
  "Alert me when a token is mentioned in 3+ alpha groups within 30 minutes",
  "Show tokens with 5+ smart money buys in the last hour",
  "Find tokens with 300%+ volume spike and no exit liquidity",
  "Monitor GambleFi tokens with rising social sentiment"
];

const previewTokens = [
  { name: 'PAWPAW', risk: 'Low', meta: 'GambleFi', roi: '+24%', volume: '$123K', holders: '1.2K' },
  { name: 'BABY BOB', risk: 'Low', meta: 'GambleFi', roi: '+34%', volume: '$456K', holders: '2.4K' },
];

export default function CreateTab({ goBack }) {
  const [prompt, setPrompt] = useState('');
  const [isTyping, setIsTyping] = useState(false);
  const [strategy, setStrategy] = useState(null);
  const [previewTokens, setPreviewTokens] = useState([]);

  const handlePromptSubmit = async () => {
    setIsTyping(true);
    // Simulate API call
    await new Promise(resolve => setTimeout(resolve, 1500));
    setStrategy({
      description: 'Strategy based on your input',
      rules: [
        { icon: 'üîç', description: 'Monitor Telegram groups' },
        { icon: 'üíº', description: 'Track smart wallet activity' },
        { icon: 'üìä', description: 'Analyze market data' }
      ]
    });
    setPreviewTokens([
      { name: 'TOKEN1', risk: 'Medium', meta: 'Trending', roi: '+15%', volume: '$1.2M', holders: '1.5K' },
      { name: 'TOKEN2', risk: 'Low', meta: 'Established', roi: '+8%', volume: '$800K', holders: '2.1K' }
    ]);
    setIsTyping(false);
  };

  return (
    <div className="relative min-h-screen w-full bg-gradient-to-b from-zinc-900 via-black to-zinc-900">
      <DndProvider backend={HTML5Backend}>
        <div className="relative z-10 p-6">
          {/* Background Gradient Effects */}
          <div className="absolute inset-0 bg-[radial-gradient(circle_at_top_right,_rgba(59,130,246,0.05),_transparent_50%)]" />
          <div className="absolute inset-0 bg-[radial-gradient(circle_at_bottom_left,_rgba(168,85,247,0.05),_transparent_50%)]" />

          {/* Back Button */}
          {goBack && (
            <div className="pt-6 pl-6 relative z-10">
              <button
                onClick={goBack}
                className="group flex items-center text-sm text-blue-400 bg-blue-500/5 px-4 py-2 rounded-lg backdrop-blur-sm transition-all hover:bg-blue-500/10"
              >
                <span className="mr-2 transition-transform group-hover:-translate-x-1">‚Üê</span>
                Back to Home
              </button>
            </div>
          )}

          <div className="max-w-5xl mx-auto px-6 py-8 relative z-10">
            {/* Data Sources Banner */}
            <div className="mb-8">
              <h3 className="text-lg font-medium text-zinc-400 mb-4">Data Sources</h3>
              <div className="flex gap-4">
                {DATA_SOURCES.map((source) => (
                  <div
                    key={source.name}
                    className={`flex items-center gap-2 px-4 py-2 rounded-lg backdrop-blur-sm transition-all ${
                      source.connected
                        ? 'bg-emerald-500/10 text-emerald-400 border border-emerald-500/20'
                        : 'bg-zinc-900/50 text-zinc-500 border border-zinc-800 hover:border-blue-500/20 cursor-pointer'
                    }`}
                  >
                    <span className="text-lg">{source.icon}</span>
                    <span>{source.name}</span>
                    {!source.connected && (
                      <button className="text-sm text-blue-400 hover:text-blue-300">
                        Connect
                      </button>
                    )}
                  </div>
                ))}
              </div>
            </div>

            {/* Header */}
            <div className="text-center mb-12">
              <h2 className="text-4xl font-bold mb-3 bg-gradient-to-r from-white via-blue-100 to-white bg-clip-text text-transparent">
                Create Your Strategy
              </h2>
              <p className="text-zinc-400">
                Describe your trading strategy in natural language
              </p>
            </div>

            <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
              {/* Main Content */}
              <div className="lg:col-span-2">
                {/* Natural Language Input */}
                <div className="mb-12">
                  <div className="relative group">
                    <div className="absolute -inset-1 bg-gradient-to-r from-blue-500/20 via-purple-500/10 to-blue-500/20 rounded-xl blur-lg group-hover:blur-xl transition-all duration-500 group-hover:opacity-75 opacity-25" />
                    <div className="relative">
                      <textarea
                        value={prompt}
                        onChange={(e) => setPrompt(e.target.value)}
                        placeholder="Example: Alert me when a token is mentioned in 3 Telegram groups and bought by 2 smart wallets"
                        className="w-full h-40 bg-black/40 backdrop-blur-xl rounded-xl p-6 text-lg text-white placeholder:text-zinc-600 focus:outline-none focus:ring-2 focus:ring-blue-500/50 resize-none border border-zinc-800"
                      />
                      <button
                        onClick={handlePromptSubmit}
                        disabled={!prompt || isTyping}
                        className={`absolute bottom-4 right-4 px-6 py-2.5 rounded-lg font-medium transition-all duration-300 ${
                          !prompt || isTyping
                            ? 'bg-zinc-800/50 text-zinc-600 cursor-not-allowed'
                            : 'bg-gradient-to-r from-blue-500 to-purple-500 text-white hover:shadow-[0_0_20px_rgba(59,130,246,0.3)]'
                        }`}
                      >
                        {isTyping ? (
                          <span className="flex items-center">
                            <svg className="animate-spin -ml-1 mr-2 h-4 w-4 text-white" fill="none" viewBox="0 0 24 24">
                              <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4" />
                              <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z" />
                            </svg>
                            Processing
                          </span>
                        ) : 'Create Strategy'}
                      </button>
                    </div>
                  </div>

                  {/* Inline Warnings */}
                  {prompt.includes('telegram') && !DATA_SOURCES[0].connected && (
                    <div className="mt-4 p-4 bg-amber-500/10 border border-amber-500/20 rounded-lg text-amber-400">
                      <p>To use Telegram group logic, please connect your groups first.</p>
                      <button className="mt-2 text-sm text-amber-300 hover:text-amber-200">
                        Connect Groups
                      </button>
                    </div>
                  )}

                  {prompt.includes('wallet') && !DATA_SOURCES[1].connected && (
                    <div className="mt-4 p-4 bg-amber-500/10 border border-amber-500/20 rounded-lg text-amber-400">
                      <p>You need to import smart wallets to use wallet-based logic.</p>
                      <button className="mt-2 text-sm text-amber-300 hover:text-amber-200">
                        Import Wallets
                      </button>
                    </div>
                  )}
                </div>

                {strategy && (
                  <div className="space-y-8 animate-fadeIn">
                    {/* Strategy Preview */}
                    <div className="relative group">
                      <div className="absolute -inset-1 bg-gradient-to-r from-blue-500/20 via-purple-500/10 to-blue-500/20 rounded-xl blur-lg opacity-25" />
                      <div className="relative bg-black/40 backdrop-blur-xl rounded-xl p-8 border border-zinc-800">
                        <h3 className="text-2xl font-bold mb-4 bg-gradient-to-r from-blue-400 to-purple-400 text-transparent bg-clip-text">
                          Strategy Preview
                        </h3>
                        <p className="text-zinc-400 mb-6">{strategy.description}</p>

                        <div className="space-y-3 mb-8">
                          {strategy.rules.map((rule, i) => (
                            <div key={i} className="flex items-center gap-4 bg-zinc-900/50 p-4 rounded-lg border border-zinc-800">
                              <span className="text-2xl">{rule.icon}</span>
                              <span className="text-zinc-300">{rule.description}</span>
                            </div>
                          ))}
                        </div>

                        <div className="flex gap-4">
                          <button className="flex-1 bg-gradient-to-r from-blue-500 to-purple-500 text-white py-3 rounded-lg hover:shadow-[0_0_20px_rgba(59,130,246,0.3)] transition-all duration-300">
                            Deploy Strategy
                          </button>
                          <button className="flex-1 bg-zinc-900 text-zinc-400 py-3 rounded-lg hover:bg-zinc-800 transition-all duration-300 border border-zinc-800">
                            Edit Strategy
                          </button>
                        </div>
                      </div>
                    </div>

                    {/* Live Preview */}
                    <div className="relative group">
                      <div className="absolute -inset-1 bg-gradient-to-r from-blue-500/20 via-purple-500/10 to-blue-500/20 rounded-xl blur-lg opacity-25" />
                      <div className="relative bg-black/40 backdrop-blur-xl rounded-xl p-8 border border-zinc-800">
                        <div className="flex items-center justify-between mb-6">
                          <h3 className="text-2xl font-bold bg-gradient-to-r from-blue-400 to-purple-400 text-transparent bg-clip-text">
                            Live Preview
                          </h3>
                          <div className="flex items-center gap-2">
                            <div className="w-2 h-2 bg-emerald-500 rounded-full animate-pulse" />
                            <span className="text-emerald-400 text-sm">LIVE</span>
                          </div>
                        </div>

                        <div className="space-y-4">
                          {previewTokens.map((t) => (
                            <div 
                              key={t.name}
                              className="group/token bg-zinc-900/50 rounded-xl p-6 hover:bg-zinc-800/50 transition-all duration-300 cursor-pointer border border-zinc-800 hover:border-blue-500/20"
                            >
                              <div className="flex justify-between items-start mb-3">
                                <div>
                                  <h4 className="text-xl font-bold text-white group-hover/token:text-blue-300 transition-colors">
                                    {t.name}
                                  </h4>
                                  <p className="text-sm text-zinc-500">
                                    Risk: {t.risk} ‚Ä¢ Meta: {t.meta}
                                  </p>
                                </div>
                                <div className="text-right">
                                  <div className="text-emerald-400 font-bold text-xl">{t.roi}</div>
                                  <div className="text-sm text-zinc-500">24h Change</div>
                                </div>
                              </div>
                              <div className="flex gap-4 text-sm text-zinc-500">
                                <div>Vol: {t.volume}</div>
                                <div>Holders: {t.holders}</div>
                              </div>
                            </div>
                          ))}
                        </div>
                      </div>
                    </div>
                  </div>
                )}
              </div>

              {/* Available Filters Sidebar */}
              <div className="lg:col-span-1">
                <div className="sticky top-8">
                  <div className="relative group">
                    <div className="absolute -inset-1 bg-gradient-to-r from-blue-500/20 via-purple-500/10 to-blue-500/20 rounded-xl blur-lg opacity-25" />
                    <div className="relative bg-black/40 backdrop-blur-xl rounded-xl p-6 border border-zinc-800">
                      <h3 className="text-lg font-bold mb-4 text-white">Available Filters</h3>
                      <div className="space-y-3">
                        {AVAILABLE_FILTERS.map((filter, i) => (
                          <div
                            key={i}
                            className="group/filter p-3 rounded-lg bg-zinc-900/50 border border-zinc-800 hover:border-blue-500/20 transition-all duration-300"
                          >
                            <div className="flex items-center gap-2">
                              <span className="text-blue-400">‚Ä¢</span>
                              <span className="text-zinc-300 group-hover/filter:text-blue-300 transition-colors">
                                {filter.label}
                              </span>
                            </div>
                            <p className="mt-1 text-sm text-zinc-500">
                              {filter.tooltip}
                            </p>
                          </div>
                        ))}
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </DndProvider>
    </div>
  );
}
